import React from 'react';
import { motion } from 'framer-motion';
import { Code, Database, Cloud, Wrench } from 'lucide-react';
import './Skills.css';

interface Skill {
  name: string;
  level: number;
  category: string;
}

interface SkillCategory {
  id: string;
  title: string;
  icon: React.ReactNode;
  skills: Skill[];
}

const Skills: React.FC = () => {
  const skillCategories: SkillCategory[] = [
    {
      id: 'frontend',
      title: 'Frontend Development',
      icon: <Code size={24} />,
      skills: [
        { name: 'React', level: 90, category: 'frontend' },
        { name: 'TypeScript', level: 85, category: 'frontend' },
        { name: 'JavaScript', level: 90, category: 'frontend' },
        { name: 'HTML/CSS', level: 95, category: 'frontend' },
        { name: 'Next.js', level: 80, category: 'frontend' },
        { name: 'Tailwind CSS', level: 85, category: 'frontend' }
      ]
    },
    {
      id: 'backend',
      title: 'Backend Development',
      icon: <Database size={24} />,
      skills: [
        { name: 'Node.js', level: 85, category: 'backend' },
        { name: 'Express.js', level: 80, category: 'backend' },
        { name: 'Python', level: 75, category: 'backend' },
        { name: 'Java', level: 70, category: 'backend' },
        { name: 'Spring Boot', level: 65, category: 'backend' },
        { name: 'REST APIs', level: 90, category: 'backend' }
      ]
    },
    {
      id: 'cloud',
      title: 'Cloud & DevOps',
      icon: <Cloud size={24} />,
      skills: [
        { name: 'AWS', level: 75, category: 'cloud' },
        { name: 'Docker', level: 80, category: 'cloud' },
        { name: 'Kubernetes', level: 70, category: 'cloud' },
        { name: 'Jenkins', level: 75, category: 'cloud' },
        { name: 'Git', level: 90, category: 'cloud' },
        { name: 'CI/CD', level: 80, category: 'cloud' }
      ]
    },
    {
      id: 'tools',
      title: 'Tools & Others',
      icon: <Wrench size={24} />,
      skills: [
        { name: 'MongoDB', level: 80, category: 'tools' },
        { name: 'PostgreSQL', level: 75, category: 'tools' },
        { name: 'Redis', level: 70, category: 'tools' },
        { name: 'Firebase', level: 85, category: 'tools' },
        { name: 'Figma', level: 75, category: 'tools' },
        { name: 'Agile/Scrum', level: 90, category: 'tools' }
      ]
    }
  ];

  return (
    <section id="skills" className="skills section">
      <div className="container">
        <motion.div
          className="section-header"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          viewport={{ once: true }}
        >
          <h2 className="section-title">Skills & Expertise</h2>
          <p className="section-subtitle">
            A comprehensive overview of my technical skills and expertise across various domains of software development.
          </p>
        </motion.div>

        <div className="skills-grid">
          {skillCategories.map((category, categoryIndex) => (
            <motion.div
              key={category.id}
              className="skill-category"
              initial={{ opacity: 0, y: 50 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: categoryIndex * 0.1 }}
              viewport={{ once: true }}
            >
              <div className="category-header">
                <div className="category-icon">
                  {category.icon}
                </div>
                <h3 className="category-title">{category.title}</h3>
              </div>

              <div className="skills-list">
                {category.skills.map((skill, skillIndex) => (
                  <motion.div
                    key={skill.name}
                    className="skill-item"
                    initial={{ opacity: 0, x: -20 }}
                    whileInView={{ opacity: 1, x: 0 }}
                    transition={{ duration: 0.5, delay: (categoryIndex * 0.1) + (skillIndex * 0.05) }}
                    viewport={{ once: true }}
                  >
                    <div className="skill-info">
                      <span className="skill-name">{skill.name}</span>
                      <span className="skill-level">{skill.level}%</span>
                    </div>
                    <div className="skill-bar">
                      <motion.div
                        className="skill-progress"
                        initial={{ width: 0 }}
                        whileInView={{ width: `${skill.level}%` }}
                        transition={{ duration: 1, delay: (categoryIndex * 0.1) + (skillIndex * 0.05) + 0.2 }}
                        viewport={{ once: true }}
                      />
                    </div>
                  </motion.div>
                ))}
              </div>
            </motion.div>
          ))}
        </div>

        <motion.div
          className="skills-summary"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.4 }}
          viewport={{ once: true }}
        >
          <div className="summary-content">
            <h3 className="summary-title">What I Bring to the Table</h3>
            <div className="summary-points">
              <div className="summary-point">
                <span className="point-number">3+</span>
                <span className="point-text">Years of Experience</span>
              </div>
              <div className="summary-point">
                <span className="point-number">20+</span>
                <span className="point-text">Projects Completed</span>
              </div>
              <div className="summary-point">
                <span className="point-number">15+</span>
                <span className="point-text">Technologies Mastered</span>
              </div>
              <div className="summary-point">
                <span className="point-number">100%</span>
                <span className="point-text">Client Satisfaction</span>
              </div>
            </div>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default Skills;
